import React from "react";
class LinkerUp extends React.Component {
  render() {
    return (
        <a href='http://localhost:3000/' id="scrollTop"><i className="icon-chevron-up"></i><i className="icon-chevron-up"></i></a>
    );
  }
}
export default LinkerUp;
